import React from "react";

function NavBar() {
  return (
    <div className="bg-red-500 h-[5em] mt-3">
      <div className="flex flex-row justify-between items-center ml-10">
        <div className="w-96 h-10 p-2.5  items-center gap-2.5 inline-flex">
          <div className="-w-2 h-4 relative"></div>
          <div className="text-[#16174F] text-xl font-normal">
            {" "}
            Parshav Holdings
          </div>
        </div>
      </div>
    </div>
  );
}

export default NavBar;
